import './App.css';
// import {Route, Switch} from "react-router";
import {BrowserRouter as Router, Route, Switch, Link} from "react-router-dom"
import Home from './Pages/Home'
import CreateRequest  from './Pages/CreateRequest';
import Register from './Pages/Register';
import Login from './Pages/Login';
import RegisterP from './Pages/RegisterP';
import LoginP  from './Pages/LoginP';
import ShowRequests from './Pages/ShowRequests';
import Error from './Pages/Error';
function App() {



  return (

    <div className='App'>
      <Router>
        <div className='navbar'>
        <Link to="/createrequest"> Create A Request</Link>
        <Link to="/">Home</Link>
        <Link to = "/login">Login Blood Bank</Link>
       <Link to="/register">Register Blood Bank</Link>
       <Link to="/registerP">Donor or Needy</Link>
       <Link to="/loginP">Login User</Link>
       <Link to="/showRequests">Show Requests</Link>
       </div>
        <Switch>
          <Route path="/"  exact component={Home} /> 
          <Route path="/createrequest" exact component = {CreateRequest} /> 
        {/* <Route path="/request/:id"  exact component={Request}/> */}
        <Route path="/login" exact component={Login}/>
        <Route path="/register" exact component={Register}/>
        <Route path="/registerP" exact component = {RegisterP}/>
        <Route path="/loginP" exact component={LoginP}/>
        <Route path="/showRequests" exact component={ShowRequests}/> 
        <Route path="/Error" exact component={Error}/>
        </Switch>
      </Router> 

    </div>

    );
}

export default App;
